import React from 'react';
import Huge from '../components/Huge';
import Carousel from '../components/Carousel';
function EducationSection(props) {
	return(
		<div id = "education" className="homelayout  homecolour" >
			<Huge  subTitle={props.subTitle} />
			<Container fluid= {true}>
				<Row className = "justify p-5">
					<Col md = {8} sm={12}>
						{props.title && <h1 className = "display-1 font-weight-bolder">{props.title}</h1>}
						{props.subTitle && <h3 className = "display-4 font-weight-light">{props.subTitle}</h3>}
						{props.text && <h3 className="lead font-weight-light">{props.text}</h3>}
					</Col>
				</Row>
			</Container>
			<ul className=" mt-3 list-group menus  intro">
                  <li>THANA SHREE JEEVANANDAM</li>

				  </ul>	
	<ul className="list-group">
				
			<li>   <a href="http://www.buffalo.edu/" className="menus a" >
               <figure className="ml-3">
              <img
                src={require("../images/ub.png")}
                style={{ width: 160, height: 140, borderRadius: 160/ 2 }}
				fluid
              />  
             
            </figure>  
            </a> </li>
		
			</ul>
			
			
			
		</div>
	);
}

export default EducationSection;
